script: |
  super -f text -I q7160.spq | sort > q7160.out

inputs:
  - name: q7160.spq
    data: |
      SELECT DISTINCT - col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE - col1 * - col2 + + col1 / + + col0 IS NOT NULL;
  - name: tab1

outputs:
  - name: q7160.out
    data: |
      -59
      -68
      -96
